noise is a peer-to-peer (p2p) networking stack with minimal dependencies which allows for extreme granularity in defining, testing, developing and deploying complex, secure, performant, and robust networking protocols in Go written by the Perlin team . By itself, noise is a low-level, stateless, concurrent networking library that easily allows you to incorporate fundamental features any modern p2p application needs such as: cryptographic primitives (Ed25519, PoW, AES-256), message serialization/deserialization schemes (byte-order little endian, protobuf, msgpack), network timeout/error management (on dial, on receive message, on send buffer full), network-level atomic operations (receive-then-lock), and NAT traversal support (NAT-PMP, UPnP). Out of its own low-level constructs, noise additionally comes bundled with a high-level protocol package comprised of a large number of production-ready, high-level protocol building blocks such as: handshake protocol implementations (Elliptic-Curve Diffie Hellman), peer routing/discovery protocol implementations (S/Kademlia), message broadcasting protocol implementations (S/Kademlia), overlay network protocol implementations (S/Kademlia), cryptographic identity schemes (Ed25519 w/ EdDSA signatures), and authenticated encryption schemes (AES-256 GCM AEAD). Every single building block is easily configurable, and may be mixed and matched together to help you kickstart your journey on developing secure, debuggable, and highly-performant p2p applications. noise is truly open-source and free. You can find the source code on GitHub . Issues and feature requests can be posted on the GitHub issue tracker . package main import ( "fmt" "github.com/perlin-network/noise" "github.com/perlin-network/noise/cipher/aead" "github.com/perlin-network/noise/handshake/ecdh" "github.com/perlin-network/noise/identity/ed25519" "github.com/perlin-network/noise/protocol" "github.com/perlin-network/noise/rpc" "github.com/perlin-network/noise/skademlia"
) func main() { params := noise.DefaultParams() params.Keys = ed25519.Random() params.Port = uint16(3000) node, err := noise.NewNode(params) if err != nil { panic(err) } protocol.New(). Register(ecdh.New()). Register(aead.New()). Register(skademlia.New()). Enforce(node) fmt.Printf("Listening for peers on port %d.\n", node.ExternalPort()) go node.Listen() select{}
}

