A message at the bare minimum comprises of two components: an opcode, and its contents. The opcode is a single unsigned byte that designates what a message contents (its string of bytes) really mean to your application. Think of it like a static type system where you may have in total \( 2^8 \) kinds of types. The opcode <-> message pairing may be specified entirely up to the user in code like so: import "github.com/perlin-network/noise" var _ noise.Message = (*RandomMessage)(nil) type RandomMessage struct{} func (RandomMessage) Read(reader payload.Reader) (noise.Message, error) { return RandomMessage{}, nil
} func (RandomMessage) Write() []byte { return []byte("This is the message contents of a single message!")
} // Register type `RandomMessage` to opcode 16.
noise.RegisterMessage(noise.Opcode(16), (*RandomMessage)(nil)) One thing that can be taken away by the code above is that messages in Noise implement the interface noise.Message . // To have Noise send/receive messages of a given type, said type must implement the
// following Message interface.
//
// Noise by default encodes messages as bytes in little-endian order, and provides
// utility classes to assist with serializing/deserializing arbitrary Go types into
// bytes efficiently.
//
// By exposing raw network packets as bytes to users, any additional form of
// serialization or message packing or compression scheme or cipher scheme may
// be bootstrapped on top of any particular message type registered to Noise.
type Message interface { Read(reader payload.Reader) (Message, error) Write() []byte
} Another little tidbit that can be taken away by the code above is that you register said mappings using the noise.Register(opcode noise.Opcode, messageType noise.Message) function, with messageType in this case being a nil pointer of your message. Should you attempt to send a message that is not registered, your application will panic as a safety precaution. If a peer sends you a message that is not registered, said peer will be automatically disconnected away from you as a safety precaution. If you believe something strange might be occuring with how opcodes are being mapped to message types, you can print them out easily by calling noise.DebugOpcodes() at any time.

