By default, the payload package prefixes all strings and byte arrays with their respective lengths. Booleans are represented as single bytes, and all integers are little-endian. Noise instantiates payload.Reader and payload.Writer instances every single time a message is received/sent respectively. You may choose to omit having to use the payload package at any time, and directly plug-n-play protobuf or msgpack to specify how your message types are serialized/deserialized should you desire. // Here's an example on how to manually specify how the message type `TestMessage`
// is formatted in terms of little-endian ordered bytes. import ( "github.com/perlin-network/noise" "github.com/perlin-network/noise/payload"
) var _ noise.Message = (*TestMessage)(nil) type TestMessage struct { someBytes []byte someString string someByte byte someUint16 uint16 someUint32 uint32 someUint64 uint64
} // It's best you manually handle and return errors inside each respective
// Read()/Write() function! This is just for demo code cleanup purposes.
func check(err error) { if err != nil { panic(err) }
} func (t *TestMessage) Read(reader payload.Reader) (noise.Message, error) { var err error t.someBytes, err = reader.ReadBytes() check(err) t.someString, err = reader.ReadString() check(err) t.someByte, err = reader.ReadByte() check(err) t.someUint16, err = reader.ReadUint16() check(err) t.someUint32, err = reader.ReadUint32() check(err) t.someUint64, err = reader.ReadUint64() check(err) return t, nil
} func (t *TestMessage) Write() []byte { return payload.NewWriter(nil). WriteBytes(t.someBytes). WriteString(t.someString). WriteByte(t.someByte). WriteUint16(t.someUint16). WriteUint32(t.someUint32). WriteUint64(t.someUint64). Bytes()
} // Register the message type to Noise.
noise.RegisterMessage(noise.NextAvailableOpcode(), (*TestMessage)(nil)) // Let's assume there exists a protobuf-defined message called `ProtobufMessage`.
//
// We can have Noise recognize it as a noise.Message by implementing
// both Read() and Write() functions for `ProtobufMessage`! import "github.com/golang/protobuf/proto" var _ noise.Message = (*ProtobufMessage)(nil) // It's best you manually handle and return errors inside each respective
// Read()/Write() function! This is just for demo code cleanup purposes.
func check(err error) { if err != nil { panic(err) }
} func (t *ProtobufMessage) Read(reader payload.Reader) (noise.Message, error) { bytes, err := reader.ReadBytes() check(err) err = proto.Unmarshal(bytes, t) check(err) return t, nil
} func (t *ProtobufMessage) Write() []byte { bytes, err := proto.Marshal(t) check(err) return payload.NewWriter(nil). WriteBytes(bytes). Bytes()
} // Register the message type to Noise.
noise.RegisterMessage(noise.NextAvailableOpcode(), (*ProtobufMessage)(nil))

