In order to send a message, you would instantiate a message you wish to send over the wire and use either of the following methods: var peer *noise.Peer
var msg noise.Message // Send a message, and block the current goroutine until the message is successfully sent.
err := peer.SendMessage(msg)
if err != nil { panic("failed to send message")
} // Send a message and create a channel which may be read for broadcasting errors at a later time.
err := <-peer.SendMessageAsync(msg)
if err != nil { panic("failed to send message")
} SendMessage(noise.Message) error sends a message whose type is registered with Noise to a specified peer. Calling this function will block the current goroutine until the message is successfully sent. On the other hand, using SendMessageAsync(noise.Message) <-chan error will not block the current goroutine, and instead simply queues the message up and lets you read from the channel for broadcasting errors anytime throughout your p2p application. Both methods above are guaranteed to block until your message to be sent gets successfully queued into the send worker. It is guaranteed that by sending message through either of the means above, all messages are sent in a linearized order. All functions will return errors if: it takes too long to send a message, the message requested to be sent is not actually registered to Noise, or the send worker responsible for linearizing the order of sent messages is too busy for too long of a period of time. It is guaranteed that SendMessageAsync will at most only emit one error; you may choose to directly close() the channel after receiving a single message should you rather not have Go's garbage collector manually close the channel for you. To figure out how to adjust the timeouts which define how long is 'too long' as to when a message is considered to have failed to be delivered, check out the Messages section in Nodes .

