One important feature Noise provides is being able to perform atomic operations over the network upon the recipient of a message. Examples of such atomic operations include blocking the recipient of any messages from a designated peer except for a specific message. This is is extremely useful for establishing synchronization points/acknowledgements between peers that from both sides, which allow us to know that they both completed some sort of action such as completing some handshake protocol scheme at the same time. import "time" var peer *noise.Peer
