Your p2p application would compose together these blocks in an order you may choose to allow you to easily build a custom, secure, and performant networking protocol. On a high level, examples of what a protocol.Block may represent are: a handshake protocol section, a session establishment protocol section, a message broadcasting protocol section, or an overlay network section. Noise provides a number of high-level, well-tested basic protocol building blocks any p2p application would need to help you kickstart building your p2p application. After picking a few blocks, or even implementing your own protocol.Block 's, you may then define your protocol like so: import ( "github.com/perlin-network/noise/protocol" "github.com/perlin-network/noise/handshake/ecdh" "github.com/perlin-network/noise/cipher/aead" "github.com/perlin-network/noise/skademlia"
) policy := protocol.New() // First, all nodes must perform an Elliptic-Curve Diffie-Hellman (ECDH) handshake
// between each other to establish a shared symmetric encryption key.
policy.Register(ecdh.New()) // The shared key from ECDH then gets derived by a HMAC to establish a new encrypted
// session where all communication between a pair of nodes is then encrypted using
// Authenticated Encryption w/ Authenticated Data (AEAD) via AES-256 GCM.
policy.Register(aead.New()) // After all communication has been readily encrypted, perform a S/Kademlia handshake
// to exchange S/Kademlia node IDs, setup a S/Kademlia routing table, and start
// handling S/Kademlia-related overlay network RPC messages.
policy.Register(skademlia.New()) The order in which you register the blocks as you may be able to tell matters, as protocol for the time being linearly traverses through all blocks in the order they are registered. After registering the ordering in which you expect peers to execute blocks, you may then enforce your custom networking protocol on multiple *noise.Node instances at once like so: import "github.com/perlin-network/noise" var node1, node2 *noise.Node // Enforce both node1 and node2 to follow your custom policy
// when it comes to dealing with peers.
policy.Enforce(node1)
policy.Enforce(node2) All peers which connect to either node1 or node2 from then on will follow your policy, and be disconnected from you should they fail to otherwise. Typically, you would define and enforce your protocol on your node before you start listening for peers and start dialing/connecting to other peers. Note: All protocol logic is handled in a separate goroutine from where nodes/peers are instantiated, so it is safe to execute blocking code inside a block so long as you intend to block a peer from progressing further from within a protocol until some condition is met.

