An ACK message is sent between two peers, and received using the atomic locking operation peer.LockOnReceive(opcodeACK) to establish a synchronization point where from a specific time onwards, all messages will be encrypted/decrypted using AEAD. Timeouts for expecting to receive the ACK message can be easily set like so: import "github.com/perlin-network/noise"
import "github.com/perlin-network/noise/cipher/aead"
import "time" block := aead.New().WithACKTimeout(3 * time.Second) // You may optionally opt out from using the builder pattern like so.
block.WithACKTimeout(5 * time.Second) Given that Noise guarantees linearized message delivery which is dependant on the transport layer used, we associate incremental nonces rather than random nonces for establishing authenticated encryption. Incremental nonces simply imply that on every message received, we increment our nonce and attempt to decrypt the received message with the new nonce. The same applies for whenever we sent a message. The code associated with handling incremental nonces is like so: import "crypto/cipher"
import "atomic"
import "binary" // ...
// Perform ACK handling and locking to establish synchronization point here.
// ... var ourNonce uint64
var theirNonce uint64
var suite cipher.AEAD peer.BeforeMessageReceived(func(node *noise.Node, peer *noise.Peer, msg []byte) (buf []byte, err error) { theirNonceBuf := make([]byte, suite.NonceSize()) binary.LittleEndian.PutUint64(theirNonceBuf, atomic.AddUint64(&theirNonce, 1)) return suite.Open(msg[:0], theirNonceBuf, msg, nil)
}) peer.BeforeMessageSent(func(node *noise.Node, peer *noise.Peer, msg []byte) (buf []byte, err error) { ourNonceBuf := make([]byte, suite.NonceSize()) binary.LittleEndian.PutUint64(ourNonceBuf, atomic.AddUint64(&ourNonce, 1)) return suite.Seal(msg[:0], ourNonceBuf, msg, nil), nil
