table := skademlia.Table(node) // Print the 16 closest peers to our node based on XOR distance.
fmt.Println(skademlia.FindClosestPeers(table, protocol.NodeID(node).(skademlia.ID).Hash(), 16)) // Directly update the liveness of a peer denoted by their ID.
var peerID skademlia.ID
err := skademlia.UpdateTable(node, peerID)
if err != nil { panic("failed to update our peers status in our kademlia table")
} The hash function used on top of our S/Kademlia public key for the time being can not be set, and is BLAKE-2b 256 bit. The routing table gets updated every single time your node receives a message from a peer, and upon completing a handshake. The routing table will only get updated should the number of prefixed byte differences between your nodes identity hash and an incoming peers identity hash exceed \(p_{len}\), and the sum of the prefixes bytes differences exceeds the value \(p_{min}\). By 'update', we refer to the routing table bucket (effectively a LRU cache) marking an incoming peers identity to be most recently used. By default based on experiments from the original S/Kademlia paper, each routing table bucket may hold at most 16 peer identities.

