In order to bootstrap your newly created node to the peers closest to you within the network, you may make use of the FIND_NODE RPC call described in Section 4.4 of S/Kademlia's paper: "Lookup over disjoint paths". Given a node instance \(N\), and a S/Kademlia ID as a target \(T\), \(\alpha\) disjoint lookups take place in parallel over all closest peers to \(N\) to target \(T\), with at most \(d\) lookups happening at once. Each disjoint lookup queries at most \(\alpha\) peers, with the RPC call returning at most \(B_{size}\) S/Kademlia peer IDs closest to that of a specified target \(T\) where \(B_{size}\) is the maximum number of IDs that may be stored within a routing table bucket. In the case of our implementation, \(B_{size}\) by default is set to 16. In amidst the disjoint lookup queries, our routing table will be populated with peers we dial/connect to; essentially enforcing the FIND_NODE RPC call to be akin to a bootstrapping mechanism for having our node connect to the peers we are closest to within our network. You may invoke the FIND_NODE RPC call after setting up your node to work with S/Kademlia like so: import "github.com/perlin-network/noise"
import "github.com/perlin-network/skademlia" func main() { params := noise.DefaultParams() params.Keys = skademlia.RandomKeys() params.Port = uint16(3000) node, err := noise.NewNode(params) if err != nil { panic(err) } protocol.New(). Register(skademlia.New()). Enforce(node) go node.Listen() // Attempt to dial a peer located at the address // 127.0.0.1:3001. peer, err := node.Dial("127.0.0.1:3001") if err != nil { panic("failed to connect to the peer we wanted to connect to") } // Block the current goroutine until we finish // performing a S/Kademlia handshake with our peer. skademlia.WaitUntilAuthenticated(peer) // Lookup the 16 (skademlia.BucketSize()) closest peers to our // node ID throughout the network with at most 8 disjoint lookups // happening at once. // // Calling this method automatically populates our routing table // and thus immediately bootstraps us/dials us to the peers closest to us // within the network. peers := skademlia.FindNode(node, protocol.NodeID(node).(skademlia.ID), skademlia.BucketSize(), 8) // Print the 16 closest peers to us we have found via the `FIND_NODE` // RPC call. fmt.Printf("Bootstrapped with peers: %+v\n", peers) // Print the peers we currently are routed/connected to. fmt.Printf("Peers we are connected to: %+v\n", table.GetPeers())
} As denoted in the code example above, a helpful function which you may use to block a particular goroutine until an incoming peer has successfully completed a S/Kademlia handshake is skademlia.WaitUntilAuthenticated(*noise.Peer) .

